import React from 'react'
import styled from 'styled-components'

function Viewers() {
  return (
    <Container>
      <Wrap>
        <img src='/images/viewers-disney.png'/>
      </Wrap>
    </Container>
  )
}

export default Viewers

const Container = styled.div`
    padding: 0 0 26px;
`

const Wrap = styled.div``
